fun main(args: Array<String>) {
    val minoFactory = MinoFactory()
    val colorConverter = ColorConverter()

    fun toBlockField(field: ColoredField): BlockField {
        val height = field.usingHeight

        val blockField = BlockField(height)
        for (y in 0..height - 1) {
            for (x in 0..9) {
                val type = field.getColorType(x, y)
                if (ColorType.isMinoBlock(type)) {
                    val piece = colorConverter.parseToBlock(type)
                    blockField.setBlock(piece, x, y)
                }
            }
        }

        return blockField
    }

    fun mirroredColorType(type: ColorType): ColorType {
        when (type) {
            ColorType.I, ColorType.O, ColorType.T -> return type
            ColorType.J -> return ColorType.L
            ColorType.L -> return ColorType.J
            ColorType.S -> return ColorType.Z
            ColorType.Z -> return ColorType.S
            else -> throw IllegalArgumentException("${type}")
        }
    }

    fun mirror(field: ColoredField): ColoredField {
        val height = field.maxHeight

        val mirrored = ArrayColoredField(height)
        for (y in 0..height - 1) {
            for (x in 0..9) {
                val type = field.getColorType(x, y)
                if (ColorType.isMinoBlock(type)) {
                    mirrored.setColorType(mirroredColorType(type), 9 - x, y)
                }
            }
        }

        return mirrored
    }

